import React from "react";
import "../Skills.css";

//const skills = [
   // { title: "React", image: "/react-native.png" },
  //  { title: "React Native", image: "/react-native.png" },
  //  { title: "NodeJs", image: "/nodejs.png" },
   // { title: "Python", image: "/python.png" },
   // { title: "Javascript", image: "/js.png" },
   // { title: "Typescript", image: "/ts.png" },
//];

const skills = {
    "Langages de Programmation": [
      { title: "Golang", image: "https://upload.wikimedia.org/wikipedia/commons/0/05/Go_Logo.svg" },
      { title: "Python", image: "https://upload.wikimedia.org/wikipedia/commons/c/c3/Python-logo-notext.svg" },
      { title: "JavaScript", image: "https://upload.wikimedia.org/wikipedia/commons/6/6a/JavaScript-logo.png" },
      { title: "TypeScript", image: "https://upload.wikimedia.org/wikipedia/commons/4/4c/Typescript_logo_2020.svg" },
      { title: "NodeJs", image: "https://upload.wikimedia.org/wikipedia/commons/d/d9/Node.js_logo.svg" }
    ],
    "Frameworks": [
      { title: "React", image: "https://upload.wikimedia.org/wikipedia/commons/a/a7/React-icon.svg" },
      { title: "React Native", image: "https://upload.wikimedia.org/wikipedia/commons/a/a7/React-icon.svg" },
      { title: "NextJs", image: "https://upload.wikimedia.org/wikipedia/commons/1/1b/Next.js_logo.svg" }
    ],
    "Bases de données": [
      { title: "PostgreSQL", image: "https://upload.wikimedia.org/wikipedia/commons/2/29/Postgresql_elephant.svg" },
      { title: "MySQL", image: "https://upload.wikimedia.org/wikipedia/commons/0/0a/MySQL_textlogo.svg" }
    ],
    "Systèmes et Outils": [
      { title: "Linux", image: "https://upload.wikimedia.org/wikipedia/commons/3/35/Tux.svg" },
      { title: "Active Directory", image: "https://upload.wikimedia.org/wikipedia/commons/6/6e/Active_Directory_logo.png" },
      { title: "GitHub", image: "https://upload.wikimedia.org/wikipedia/commons/9/91/Octicons-mark-github.svg" },
      { title: "GitLab", image: "https://upload.wikimedia.org/wikipedia/commons/1/18/GitLab_Logo.svg" },
      { title: "Postman", image: "https://upload.wikimedia.org/wikipedia/commons/a/a7/Postman_logo_2020.svg" }
    ]
  };


  const Skills = () => {
    return (
        <section id="skills" className="skills">
            <h2>Mes compétences techniques</h2>
            <div className="skills-container">
                {Object.keys(skills).map((category, index) => (
                    <div key={index} className="skills-category">
                        <h3>{category}</h3>
                        <div className="skills-list">
                            {skills[category].map((skill, index) => (
                                <div key={index} className="skill">
                                    <img src={skill.image} alt={`Logo de ${skill.title}`} />
                                    <p>{skill.title}</p>
                                </div>
                            ))}
                        </div>
                    </div>
                ))}
            </div>
        </section>
    );
};

export default Skills;
